css:
.git-plus .alert {
  color: #c69a6d;
}
.git-plus .success {
  color: #6ac38a;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #4da4b7;
}
.meta.diff.header {
  color: #4da4b7;
}
.markup.deleted.diff {
  color: #c45546;
}
.markup.inserted.diff {
  color: #6ac38a;
}
